import React from 'react';
import { Routes, Route } from 'react-router-dom';

// Importirajte svoje komponente ovdje. Pretpostavljam da su ovo nazivi datoteka vaših komponenata.
import EvidencijaLovaca from './EvidencijaLovaca';
import RasporedAktivnostiILova from './RasporedAktivnostiILova';
import EvidencijaPrisutnostiNaLovniDan from './EvidencijaPrisutnostiNaLovniDan';
import UnosDivljaci from './UnosDivljaci';
import UnosOdstrijeleneDivljaci from './UnosOdstrijeleneDivljaci';
import Bodovi from './Bodovi';

// Komponenta za rute
const AppRoutes = () => {
    return (
        <Routes>
            <Route path="/evidencija-lovaca" element={<EvidencijaLovaca.js />} />
            <Route path="/raspored-aktivnosti-i-lova" element={<RasporedAktivnostiILova />} />
            <Route path="/evidencija-prisutnosti-na-lovni-dan" element={<EvidencijaPrisutnostiNaLovniDan />} />
            <Route path="/unos-divljaci" element={<UnosDivljaci />} />
            <Route path="/unos-odstrijelene-divljaci" element={<UnosOdstrijeleneDivljaci />} />
            <Route path="/bodovi" element={<Bodovi />} />
            {/* Možete dodati dodatne rute ovdje */}
            {/* <Route path="/neka-druga-putanja" element={<NekaDrugaKomponenta />} /> */}
        </Routes>
    );
};

export default AppRoutes;
